import Meta from "./Meta";
import Form from "./Form";
import GlobalStyle from "./styles/GlobalStyle";
import styled from "styled-components";
const StyledPage = styled.div`
  width: 100%;
  height: 100%;
  background: red;
`;
class Page extends React.Component {
  render() {
    return (
      <React.Fragment>
        <GlobalStyle />
        <Meta />
        <Form />
      </React.Fragment>
    );
  }
}
export default Page;
